import './App.css';

import { BrowserRouter, Switch , Routes, Route} from 'react-router-dom';

import ShowProducto from './components/ShowProducto';
import React from 'react';
// import login

// import{}from

function App() {
  return (
    <div className="App">
      <React.Fragment>
      <BrowserRouter>
        <Switch>
          <Route path='/'  element={<ShowProducto/> } />
        </Switch>
      </BrowserRouter>
      </React.Fragment>
      {/* <BrowserRouter>
        <Routes>
          <Route path='/catalogo'  element={<ShowProducto/> } />
        </Routes>
      </BrowserRouter> */}

    </div>
  );
}

export default App;
